Synopsis

The plot revolves around a fictitious Onion television news anchorman, Norm Archer (Len Cariou), who is forced to face the inevitability of a corporate takeover by the Onions perennial fictitious multinational, Global Tetrahedron. Onion news is described as &quot;fair and balanced&quot; in the context of the film. The plot serves as a springboard for various comedy sketches featuring The Onion's satirical humor. Vignettes include parodies of music videos reminiscent of Britney Spears' work, and Steven Seagal appearing as a parody of the type of action hero he normally portrays. The film is interrupted (fictitiously) by film reviewers and commentators weighing in on the progress of the film, with one commentator preparing to stage an immediate walkout of all African American audience members unless a positive portrayal of an African American is inserted into the film.

